import React from 'react';
import { Text, View, StyleSheet } from 'react-native';
import './square.css';

/**
 * props:
 *
 * type - 
 * x    - 
 * y    - 
 */
class Square extends React.Component {
	render() {
		return (
			<div className="square">
				<View style={styles.container}>
					<View style={styles.square}/>
				</View>
			</div>
		);
	}
}

export default Square;
